// api/productApi.js

import axiosClient from "api/axiosClient";
import { axiosTeamClient } from "api/axiosClient";
const axios = require('axios').default;
const JsonPlaceHolderApi = {
  getAll: (params) => {
    const url = "/posts";
    return axiosClient.get(url, { params });
  },
  getPlantInfo: (params) => {
    const url = "/LeakInfoFromWiki";
    return axiosTeamClient.get(url, { params });
  },
  login: (params) => {
    const url = "/api/Login/WebLogin";
    return axiosTeamClient.post(url, { params });
  },
  shareDetail: (params) => {
    const url = "/api/ShareDetail";
    // return axiosTeamClient.post(url, { params: params });
    return axios.post("http://54.179.74.214:8080/api/ShareDetail",{
      params
    })
  },
};
export default JsonPlaceHolderApi;
